import React, { Component } from 'react';

import logo from './logo.svg';
import heartOn from './heart-on.png';
import heartOff from './heart-off.png';
import starOn from './star-on.png';
import starOff from './star-off.png';

import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          {/* <img src={logo} className="App-logo" alt="logo" /> */  }

          <div className="Side-bar-container">
            <div className="Side-bar" id="Hearts-bar">
              <img src={heartOn} className="Side-icon" id="Heart-icon" alt="heart icon" />  
              <img src={heartOn} className="Side-icon" id="Heart-icon" alt="heart icon" />  
              <img src={heartOn} className="Side-icon" id="Heart-icon" alt="heart icon" />  
            </div>
            <div className="Side-bar" id="Stars-bar">
              <img src={starOn} className="Side-icon" id="Star-icon" alt="star icon" />  
              <img src={starOn} className="Side-icon" id="Star-icon" alt="star icon" />  
              <img src={starOn} className="Side-icon" id="Star-icon" alt="star icon" />  
            </div>
          </div>

          <div className="Box">
            <div className="Dialogue-content"></div>
            <div className="Response-button-row"></div>
          </div>
        </header>
      </div>
    );
  }
}

export default App;
